[Q]: Please provide me the patients who have received an immunization with the CVX "010".
[SPARQL]: PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>
PREFIX snomed: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#snomed:SNOMED-CT>
PREFIX uuid: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#urn:uuid>
PREFIX cvx: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#hl7:CVX>
SELECT DISTINCT ?first ?last
WHERE {
  ?exposure a snomed:Exposure;
  cvx:vaccineType "010"^^cvx:CVX;
  snomed:hasAssociatedProcedure ?procedure;
  snomed:hasActiveIngredient ?ing.
  ?patient a syn:Patient;
  syn:id ?patientId;
  syn:first ?first;
  syn:last ?last;
  syn:exposureEvent ?exposureId.
  ?procedure syn:performedOn ?exposureId;
  snomed:hasBodySite ?bs;
  snomed:hasProcedureSite ?ps.
  ?bs snomed:hasModifier ?bsmod;
  ?ps snomed:hasModifier ?psmod.
  ?ing snomed:hasModifier ?ingmod.
}

