PREFIX ct:<https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#umls:RxNorm>
SELECT DISTINCT ?drugname
WHERE {
  ?patient a syn:Patient;
  syn:full ?fullname;
  syn:id ?patientId.
  ?encounter a syn:Encounter;
  syn:patient ?patientId;
  syn:id ?encounterId.
  ?prescription a syn:Prescription;
  syn:encounter ?encounterId;
  syn:drug ?drug.
  ?drug ct:name ?drugname.
  FILTER (?fullname = pl: "William Farris"^^xsd:string)
}

